import './App.scss';
import FotoCv from './FotoCV.png';
import {BrowserRouter as Router,Switch,Route,Link,useParams} from "react-router-dom";
import Information from './components/Information'

const Header =()=>{
    const params = useParams();
    return(
        <header><h1>{params.id}</h1></header>
    )};

const Nav =()=>(
<Router>
<nav>
<div id='first'>
<div id="Foto">
<img src={FotoCv} alt="Foto CV"/>
</div>
<h1>Ezequiel Yacar</h1>
</div>
<div id='nav'>
<ul>
<Link to='/Información'><li>Información Personal</li></Link>
<li>Resumen Ejecutivo </li>
<li>Educación</li>
<li>Experiencia Laboral</li>
<li>Habilidades</li>
<li>Contacto</li>
</ul>
</div>
</nav>
<Header/>
<Switch>    
<Route path='/:id'><Information/></Route>    
</Switch>
</Router>
)

export default Nav;
